import React from "react";
import './HomePage.css';

function ProblemsPage() {
    return (
        <body>
            {/* <div className="header">
                <img src="/Assets/logo.png" alt="Logo" />
            </div> */}
            <div className="dashboard">
                <h1><img src="/Assets/DashboardLogo.png" alt="Logo" />Dashboard</h1>
                <h1>Problems</h1>
                <button><img src="/Assets/" alt="" />Leaderboard</button>
                <button><img src="" alt="" />Discussion</button>
                <button><img src="" alt="" />Progress</button>
                <button><img src="" alt="" />Profile</button>
            </div>

        </body>
    );
}

export default ProblemsPage;
